import React from 'react';

const Metamon = () => {
  return (
    <div className="metamonWrapper">
      <div className="metamon">Metamon</div>
      <div className="metamonInner">
        <h3>Metamon Center (Gacha Center):</h3>
      </div>
    </div>
  );
};

export default Metamon;
